import React from 'react'
import Chart from 'chart.js/auto'
import { Line } from 'react-chartjs-2'
//import dateFnsFormat from 'date-fns'

const DataChart = () => {
  return (
    <Line
      data = {
        {
          labels: ['Jan', 'Feb', 'March'],
          datasets: [
            {
              label: 'first',
              data: [3, 7, 4]
            }
          ]
        }
      }
      options = {{
        scales: {
          x: {
            type: 'time',
            time: {
              unit: 'day'
            }
          }
        }
      }}
    />
  )
}

export default DataChart
